import React from 'react';
import ToDoSpan from "./to-do-span";

const TaskLabel = ({label}) =>{
    return (
        <label for="">
            <ToDoSpan className="description" test={label}></ToDoSpan>
            <ToDoSpan className="created"></ToDoSpan>
        </label>
    )
}

export default TaskLabel;
